import React,{useEffect} from 'react'
import axios from 'axios'

const ApiExterno = () => {
    const [tabela, setTabela]=setState()

    useEffect(()=>{
        axios.get('http://localhost:3004/promotions').then((resp)=>{
            console.log(resp.data)
        })
    }, [])

    return(
        <div>
            <h1>Rota esterna</h1>
        </div>
    )
}
export default ApiExterno;
